/* ---------- Wikipédia_PureDark ---------- */

/* ---------- v1.0 / 08-11-2016 ---------- */

/* by woam */



@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("wikipedia.org") {
 

  
  
  
  
  
  
  /* Fond Général */
 div#mw-head, body, .mw-body, .mw-body-content, .accueil-cadre, .mw-content-ltr .toc ul, .mw-content-ltr #toc ul,
  .mw-content-rtl .mw-content-ltr .toc ul, .mw-content-rtl .mw-content-ltr #toc ul, div.accueil-droite,
  div#accueil-lumieresur.accueil-cadre > div>div, .infobox_v3 .entete > div
  /*, #p-logo a, #p-logo*/
  
  
  {background:url('data:image/png;base64,');

background-attachment:fixed;	
	}
  
  
  /* Texte Principale*/
  div {
	color: #747474 !important;
   font-size: 1.01em;
  }
  
  .mw-body p{
	color: #7C7C7C !important;
   font-size: 1.1em;
  }
  
  /* Liens */
  a {
  color: #6A9178 !important;
  }
  /* Liens survolés */
 a:hover {
  color: #00BF60 !important;
  } 
  
  h1, h2, h3, h4, h5, h6 {
	color: #477083!important;
	background: none!important;;
	padding-bottom: .17em;
	border-bottom: 1px solid #477083;
  }
  
  div.bandeau-section {
	display: block;
	font-size: 0.95em;
	border-width: 0px 0;
	}

    
  /* Bandeau d'Informations */
  .bandeau-niveau-ebauche, .bandeau-niveau-information {
	border-color: #003859!important;
	}

  /* Menu Droit */
  div.infobox_v3 {	
	border: 2px solid #323247!important;
	font-size: 0.9em;
	line-height: 1.4em;
	margin: 0 0 0.5em 1em;
	word-wrap: break-word;
}

  .infobox_v2{
    border: 2px solid #323247!important;
     }
  .infobox_v2 th {
    color: #477083!important;
  }
  div.boite-a-droite {
  border: 2px solid #323247!important;  
  }
  
  

  /* Couleur Texte Recherche */
  input#searchInput{
    color: #7A9192!important;
  }
 
  .suggestions a.mw-searchSuggest-link {
	color: #7A9192!important;
}
  .suggestions a.mw-searchSuggest-link:hover, .suggestions a.mw-searchSuggest-link:active, .suggestions a.mw-searchSuggest-link:focus{
  background-color: #ff0800!important;
  }
  
  
  
  /* Boutons Supérieurs */
  .vectorTabs span{
    border-radius:0px !important;
  }
  
  
  /* Ligne Cadre Claire */
  
 div.thumbinner, .homonymie, #toc, .toc, div#simpleSearch, div.suggestions-results, div.globegris,
 div.accueil-gauche, div.accueil-droite, table.navbox, #bandeau-portail, .catlinks, .suggestions-special,
  .mw-search-profile-tabs,
  .oo-ui-buttonElement-framed.oo-ui-widget-enabled.oo-ui-flaggedElement-primary.oo-ui-flaggedElement-progressive > .oo-ui-buttonElement-button
  

  {
   border-width: 2px!important; 
   border-color: #323247!important;
  }
  
   
  
  
  /* ------ Bas de Page ------ */
  
  /* Dernière modification de la page */
  #footer-info-lastmod{
	color: #DF7000!important;
	font-size: 0.7em;
  }
  
  /* Copyright */
  #footer-info-copyright {
	display:none!important;
  }
  /* Icônes */
 #footer-icons {
	display:none!important;
  }
  
  /* politique confidentialité, etc */
  #footer-places {
	display:none!important;
  }
 
  /* suppression fond titres */
  div.accueil-gauche > div>div>div>img {
    display:none!important;
	}
 
  /* Suppression images dégradées titres */
  div#presentation.accueil-cadre > div {
    background: transparent;
  }
  
  /* Couleur Titre Boite droite*/
  .infobox_v3 .entete > div {
	color:#477083!important;
  }
   td.entete{
    color:#477083!important;
  }
  
  /* Couleur texte recherches page Recherches */
  .oo-ui-textInputWidget input {
    color:#7A9192!important;
  }
 
  /* Couleurs Bouton recherches page Recherches */
 .oo-ui-buttonElement-framed.oo-ui-widget-enabled.oo-ui-flaggedElement-primary.oo-ui-flaggedElement-progressive > .oo-ui-buttonElement-button {
	color: #6A9178;
	
  }  
  .oo-ui-buttonElement-framed.oo-ui-widget-enabled.oo-ui-flaggedElement-primary.oo-ui-flaggedElement-progressive > .oo-ui-buttonElement-button:hover {
	color: #00BF60;	
	
  }
  
  /* Champ de recherche page Recherches */
 .oo-ui-textInputWidget {
	width: 101%;
	max-width: 50em;
  border-width: 10px;
}
/* Suppression ligne base boite droite */
 td.navigation-only, .infobox_v3 .bordered.nav, .infobox_v3 .bordered.navbar {
border-top:0px!important;
}

  /* Couleur Jour sélectionné Ephéméride */
.infobox_v3 td.data> strong.selflink {
color:#00D500!important;
  }
  
  /* Couleur Tableaux */
  table.wikitable {
		color: #7C7C7C;
}
table.wikitable > caption {
		color: #477083;
  }
 
table>tbody>tr>td>div>img {
background:none!important;
}

  
  
  
 /* Fond  CLAIR */ 
  div.bandeau-section, #toc, .toc, .bandeau-niveau-ebauche, .bandeau-niveau-information, div.infobox_v3, .infobox_v2, div.boite-a-droite, .homonymie, .vectorTabs span, div.thumbinner,
  div#presentation.accueil-cadre > div, div#participation.accueil-cadre > div, div#conunaute.accueil-cadre > div, div#projets-freres.accueil-cadre > div, .infobox_v2 .entete,
  div#accueil-lumieresur.accueil-cadre > div, table.navbox, th.navbox-title, #bandeau-portail, .catlinks,
  div#simpleSearch, div.suggestions-results, .suggestions-special, .suggestions-special .special-label, .suggestions-special .special-query,
  .mw-search-profile-tabs,
  .oo-ui-textInputWidget input,
  .oo-ui-buttonElement-framed.oo-ui-widget-enabled.oo-ui-flaggedElement-primary.oo-ui-flaggedElement-progressive > .oo-ui-buttonElement-button,
  .infobox_v2 th, div.infobox_v3, .infobox_v3 .entete, div.entete icon calendrier, .infobox_v3 table, .infobox_v3 caption, .infobox_v3 .overflow, .infobox_v3 p.bloc,
  table.wikitable, table.wikitable.centre, table.wikitable > tbody>tr>th, div.mw-content-text>table>tbody>tr
  
{background: url('data:image/jpeg;base64,')!important;
		
		border-radius:10px;

  }
  
 /* LOGO */


#p-logo a {

        background-image: url('http://tinyurl.com/j3u3wy3') !important;
        background-repeat:no-repeat;
           
        /*opacity:0.9!important;*/
    }

}


/* ---------------------- END --------------------- */
